(let [object-image (imread "resources/box.png" Imgcodecs/IMREAD_GRAYSCALE)
      scene-image (imread "resources/box_in_scene.png" Imgcodecs/IMREAD_GRAYSCALE)
      image-matches (image-matches object-image scene-image)]
  (g/>> image-matches))
